      function stringToBin(input) {
        result = "";
        for (var i = 0; i < input.length; i++) {
          var byte = input[i].charCodeAt(0).toString(2)
          while (byte.length < 8) byte = "0" + byte;
          result += byte;
        }
        return result;
      }  

      function decryptTest() {
        var canvas = document.getElementById('canvas1');
        var ctx = canvas.getContext('2d');
        var imageData = ctx.getImageData(0,0,2000,1333);
        binary = "";
        for (var i=0; i<8*13; i++) { 
          binary += (imageData.data[i*4+3]===254 ? "1" : "0") 
        }
        result = "";
        for (var i=0; i<binary.length; i+=8) {
          result += String.fromCharCode(parseInt(binary.substr(i,8),2));
        }
        var target = document.getElementById('target');
        target.value = result;
        console.log(result);

      }

      function draw() {
        var canvas = document.getElementById('canvas1');
        var plainText = document.getElementById('source').value;
        var binaryPT = stringToBin(plainText);
        var ctx = canvas.getContext('2d');
        var img = new Image();
        img.onload = function() {
          ctx.drawImage(img,0,0);
          var pixelData = ctx.getImageData(0, 0, img.width, img.height);
          // actual size is X4 than that, but we want to use only the alpha??
          var colorDataLength = img.width * img.height;
          for (var i=0; i<binaryPT.length; i++) {
            if (binaryPT[i] === "1") {
              pixelData.data[i*4+3]--;
            }
          }
          ctx.putImageData(pixelData,0,0);
      };
      //img.src = srcElement.value;
      img.src = data;
